/****** Object:  Table dbo.CameraCodes ******/
CREATE TABLE dbo.CameraCodes(
	locationID int NOT NULL,
	cameraTypeCode varchar(10) NOT NULL,
	suburb varchar(50) NOT NULL,
	roadName varchar(50) NOT NULL,
	roadType varchar(10),
 CONSTRAINT CameraCodes_PK PRIMARY KEY (locationID ASC, cameraTypeCode ASC)
);

/****** Object:  Table dbo.CameraTypes ******/
CREATE TABLE dbo.CameraTypes(
	cameraTypeCode varchar(10) NOT NULL,
	cameraType varchar(50) NOT NULL,
	parentCameraTypeCode varchar(10),
 CONSTRAINT CameraTypes_PK PRIMARY KEY (cameraTypeCode ASC)
);

/****** Object:  Table dbo.CountryStates ******/
CREATE TABLE dbo.CountryStates(
	countryStateCode varchar(5) NOT NULL,
	countryState varchar(50),
 CONSTRAINT CountryStates_PK PRIMARY KEY (countryStateCode ASC) 
 );

/****** Object:  Table dbo.ExpiationCategories ******/
CREATE TABLE dbo.ExpiationCategories(
	categoryID int IDENTITY(1,1) NOT NULL,
	categoryName varchar(100) NOT NULL,
	description varchar(100),
	parentCategoryID int,
 CONSTRAINT expiationCategories_PK PRIMARY KEY (categoryID ASC)
 );

/****** Object:  Table dbo.LocalServiceAreas ******/
CREATE TABLE dbo.LocalServiceAreas(
	lsaCode varchar(10) NOT NULL,
	lsaDescription varchar(50) NOT NULL,
 CONSTRAINT LocalServiceAreas_PK PRIMARY KEY (lsaCode ASC) 
 );

/****** Object:  Table dbo.NoticeStates ******/
CREATE TABLE dbo.NoticeStates(
	statusCode varchar(5) NOT NULL,
	statusDescription varchar(50) NOT NULL,
 CONSTRAINT NoticeStatus_PK PRIMARY KEY (statusCode ASC)
 );

/****** Object:  Table dbo.NoticeTypes ******/
CREATE TABLE dbo.NoticeTypes(
	typeCode varchar(5) NOT NULL,
	typeDescription varchar(50) NOT NULL,
 CONSTRAINT NoticeTypes_PK PRIMARY KEY (typeCode ASC)
);

/****** Object:  Table dbo.Offences ******/
CREATE TABLE dbo.Offences(
	offenceCode varchar(5) NOT NULL,
	description varchar(500) NOT NULL,
	expiationFee int,
	adultLevy int,
	corporateFee int,
	totalFee int,
	demeritPoints int,
	sectionID int,
	sectionCode varchar(25),
 CONSTRAINT Offences_PK PRIMARY KEY (offenceCode ASC)
 );

/****** Object:  Table dbo.OffenceStates ******/
CREATE TABLE dbo.OffenceStates(
	statusCode varchar(5) NOT NULL,
	statusDescription varchar(50) NOT NULL,
 CONSTRAINT OffenceStates_PK PRIMARY KEY (statusCode ASC)
 );

/****** Object:  Table dbo.PhotoRejections ******/
CREATE TABLE dbo.PhotoRejections(
	rejectionCode int NOT NULL,
	rejectionDescription varchar(50) NOT NULL,
 CONSTRAINT PhotoRejections_PK PRIMARY KEY (rejectionCode ASC)
 );

/****** Object:  Table dbo.Sections ******/
CREATE TABLE dbo.Sections(
	sectionID int IDENTITY(1,1) NOT NULL,
	categoryID int NOT NULL,
	sectionCode varchar(25) NOT NULL,
	sectionName varchar(100) NOT NULL,
	expiable bit NOT NULL DEFAULT 'True',
 CONSTRAINT Sections_PK PRIMARY KEY (sectionID ASC)
 );


/****** Object:  Table dbo.SpeedingCategories ******/
CREATE TABLE dbo.SpeedingCategories(
	speedCode char(1) NOT NULL,
	offenceCode varchar(5) NOT NULL,
	speedDescription varchar(50) NOT NULL,
 CONSTRAINT SpeedingCategories_PK PRIMARY KEY(speedCode ASC, offenceCode ASC)
 );

/****** Object:  Table dbo.WithdrawnReasons ******/
CREATE TABLE dbo.WithdrawnReasons(
	withdrawCode varchar(5) NOT NULL,
	withdrawReason varchar(50) NOT NULL,
 CONSTRAINT WithdrawnReasons_PK PRIMARY KEY (withdrawCode ASC)
 );



